import React from "react";
import { View, Image,Text,StyleSheet } from "react-native";
import igLogo from "../../images/IG-logo.png"
import tw from "twrnc"

export default function AppbarGlobal() {
  return (
    <View>
      <Image
      width="104px"
      height="30px"
      style={tw`w-[104px] h-[30px]`}
      source={(igLogo)}
      />
      <Text>Hiii</Text>
    </View>
  );
}
